INSERT INTO `counties_cities` VALUES ('AR', 'Faulkner', '', '', '', 'G', '70', 'Conway', '115 (3s) Ultimate', 'J. Lynn Hicks', '501-450-6107', 'Lynn.Hicks@cityofconway.org', '42020', 'City of Conway requires the following Language in the SA:\n?This analysis has been performed in accordance with the TIA/EIA-222-G standard and 2012 Arkansas Fire Prevention Code, Volume II (2012 International Building Code with State of Arkansas Amendments) based on an ultimate 3-second gust wind speed of 115 mph converted to a nominal 3-second gust wind speed of 89 mph per section 1609.3.1 as required per Exception #5 of Section 1609.1.1.  Exposure Category X and Risk Category II.?  \n**Add this after \'Exposure Category X\' if Topo is considered, \"with a maximum topographic factor, Kzt, of X.XXX\"');
INSERT INTO `counties_cities` VALUES ('CA', 'Entire State', '', '', '', 'G', '', 'Entire State', '', '', '', '', '41416', 'The Division of the State Architect (DSA) provides design and construction oversight for K?12 schools, community colleges, and various other state-owned and leased facilities.  The DSA requires analyses and drawings be signed by a Licensed California Structural Engineer (SE)');
INSERT INTO `counties_cities` VALUES ('CA', 'El Dorado', '', '', '', 'G', '', 'El Dorado County', 'Varies See Notes:\n130 (3s) Ultimate\nOR\n110 (3s) Ultimate', 'Building Services', '(530) 621-5315', 'bldgdept@edcgov.us', '42649', 'The County website supplies Building Design Criteria per Parcel Number.  The minimum wind speeds for the County are 110 mph and 130 mph within the Special Wind Region; see Map for Special Wind Region or use Parcel lookup within link.');
INSERT INTO `counties_cities` VALUES ('CA', 'Kern', '', '', '', 'G', '', 'California City', '130 (3s) Ultimate\n101 (3s) Nominal ', 'Joe Barragan - Building Inspector', '(760) 373-7162', 'jbarragan@californiacity.com', '41655', 'The City is within a Special Wind Region and requires a 130 mph Ultimate (101 mph Nominal) 3-sec gust wind speed.');
INSERT INTO `counties_cities` VALUES ('CA', 'Kern', '', '', '', 'G', '', 'Kern County', 'Varies See Notes:\n130 (3s) Ultimate\n101 (3s) Nominal\nOR\n110 (3s) Ultimate\n85 (3s) Nominal', 'Greg Fenton - Director', '(661) 862-8650', 'bid@co.kern.ca.us', '42909', '1/1/2017: The County updated wind speed requirements per 2016 CBC: Structures West of the LA Aqueduct are in a Special Wind Region and require a 130 mph Ultimate (101 mph Nominal) 3-sec gust wind speed.  Structures East of the LA Aqueduct require a 110 mph Ultimate (85 mph Nominal) 3-sec gust wind speed. Check Map (See Link, choose \"2016 Kern County Code of Building Regulations\" and scroll to p. 41/161 in pdf).\n\n1/1/2017 Updated Wording: The County special wording updated: \"The analysis has been performed in accordance with the TIA/EIA-222-G Standard and the 2016 CBC based on an ultimate 3-second gust wind speed of XXX mph converted to a nominal 3-second gust wind speed of XXX mph per section 1609.3.1 as required per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of X.XXX, Risk Category II and Classification U was/were used in this analysis. The seismic design category and site class are D, as determined in \"Appendix C - Additional Calculations\" of this report.\"  The last sentence is Only to be included if seismic calculations are required.\nThe County requires seismic calculations for every site within Kern County\'s Jurisdiction per TIA-222-G.  Per Plan Review: In accordance with CBC Section 3108.1, towers shall be designed for seismic loads; exceptions related to seismic design listed in TIA-222 Section 2.7.3 shall not apply. ');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', '', 'BU# 877935', '115 (3s Ultimate)', 'Wenceslao Pepe Reynoso- Senior Building Inspector', '(323) 583-8811 x243', '', '42298', 'The City of Vernon requires this site to be categorized as a Risk Category III structure (115 mph Ultimate). The City is also requiring that the analysis is based upon the higher seismic importance factor criteria of 1.25.');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', '', 'Baldwin Park', '110 Ultimate (3s) 130 Ultimate (3s)\nsee Notes', 'Robert Mc Colum- Building Official', '(626) 813-5265', 'rmccolum@baldwinpark.com', '42452', 'The City requires a 130 mph Ultimate wind speed for sites within the Special Wind Region.');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', '70', 'Diamond Bar', '110 (3s) Ultimate\n85 (3s) Nominal ', 'Jeff', '(909) 839-7020', 'building@diamondbarca.gov', '41962', 'The City requires a 110 mph 3-sec gust Ultimate wind speed.  Previous entry stated, \"Bechtel reviewed for customer (AT&T) and enforced LA County requirement.  This is the only tower we have in Diamond Bar.\" (100 mph 3-sec per 2010 CBC/2009 IBC)\nThis entry is outdated since there are now 7 Towers in the Town of Diamond Bar.');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', '', 'Los Angeles (City)', '110 (3s) Ultimate\n85 (3s) Nominal ', 'Jesse Cardoza- Struc Plan CK', '(213) 482-6718', 'jesse.cardoza@lacity.org', '42753', 'The City of Los Angeles requires Structure Class III for Seismic analysis and Structure Class II for Wind loads.  Procedure:\n\n1. Specific wording on the cover page, Default Wording:\n\nThe analysis has been performed in accordance with the TIA/EIA-222-G Standard, the 2016 California Building Code (CBC) with the 2017 LABC amendments, including the added Section 91.3108.1 to Article 1 of Chapter IX of the Los Angeles Municipal Code per Ordinance # 183580, effective July 11, 2015. Accordingly, the analysis has been based on:\n\nSeismic Analysis: Class III structure, with 1.5 Importance Factor. In addition, the following parameters were also applied: Site Class D with spectral acceleration factors Ss of x.xxxg and S1 of x.xxxg.\n\nWind Analysis: Class II structure. Using TIA-222 per Exception #5 of CBC Section 1609.1.1 with a 3-second gust ultimate wind speed of 110 mph, converted to a nominal 3-second gust wind speed of 85 mph per CBC Section 1609.3.1. In addition, for this site, the following parameters were also applied: Exposure Category X and a maximum Topographic Factor, Kzt, of x.xx.');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', '', 'Los Angeles (City)\nContinued', '', '', '', '', '', '2. Two Separate full analyses (in one report), one for wind and one for seismic. Include separate ratings for the wind and seismic capacities in Section 4 (Table 5) of the SA Report.  Separate Tables for Wind and Seismic: Table 5, Table 6, etc. as needed.\n\n3. Wind load based on TIA risk category II, V_ultimate = 110 mph (V_nominal = 85 mph).  No special wind region requirements applicable.\n\n4. Seismic load based on TIA risk category III (I=1.5). For Seismic Analysis:\n     a) When the typical TNX analysis process is used and the structure is found passing, use the TNX approach and ensure the MTO page has a statement line indicating TIA Risk Category III (I=1.5). \n     b) When the typical TNX analysis process results in a failing SA, then use RISA 3D full modal dynamic analysis, considering the maximum period of the structure (not capped as done for buildings), and ensuring the minimum seismic base shear is met. \n     c) For the anchor rods, and flange bolts when applicable, apply the seismic over-strength factor (?o) to verify the anchor rods, and flange bolts when applicable.  Then, there will be 2 calculations, one without ?o to verify the plates / stiffeners (blockading the results for the anchor rods / bolts), and a separate run with ?o for the verification of the anchor rods/bolts, blockading the results for the plates.  Clearly indicate which case is which with a note in the load input.  For cases the base plate has been modified, clearly indicate the configuration and distribution of forces for the original rods and the mod rods. ');
INSERT INTO `counties_cities` VALUES ('CA', 'Los Angeles', '', '', '', 'G', 'Language Requirement', 'Los Angeles County and\nUnincorporated Areas of the County + 15 Incorporated Cities (See Notes)', 'Language Requirement', 'Aleia N. Long-Padilla- Building & Safety', '(661) 222-2940 x242', 'ALONG@dpw.lacounty.gov', '42816', 'The County Jurisdiction does not have special wind regions per ATC, however, Municipalities within County may have local amendments that require a higher wind speed.\nThere are 15 Incorporated Cities that contract Building and Safety Services from our Department:\n\nArtesia, Carson, Cerritos, Commerce, Industry, Irwindale, La Canada Flintridge, Lakewood, La Mirada, Lawndale, Lomita, Rolling Hills, Rolling Hills Estates, Sante Fe Springs, Temple City, Westlake Village\n\nSpecial Language required on cover letter:  \"The analysis has been performed in accordance with the TIA/EIA-222-G Standard per Section 3108.1 of the 2017 LACBC and the 2016 CBC with an ultimate 3-second gust wind speed of 110 mph converted to a nominal 3-second gust wind speed of 85 mph per section 1609.3.1 as required per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of X.XXX and Risk Category II was/were used in this analysis.\"\n\nFor Structural Letters provide a short analysis specifying existing loading and proposed loading and the percentage increase in rating.  If the increase is less than 10%, additional analysis will not be required. If the additional loading exceeds 10%, you will need to provide full structural analysis.  Please be aware that if other companies have previously made modifications to a particular site, the cumulative load will need to be under the 10% threshold to avoid additional analysis.');
