INSERT INTO `counties_cities` VALUES ('CA', 'Nevada', '', '', '', 'G', '', 'County', '110 Ultimate (3s) 130 Ultimate (3s)\nsee Notes', 'Dan Sciacca- Plan Reveiw', '(530) 470-2538', 'Dan.Sciacca@co.nevada.ca.us', '42410', 'The County will accept Placer County wind speeds until the code is amended:\nCounty requires the following wind speeds (3 sec gust)  based on elevation (Do NOT include topo effects with these wind speeds; Exp. Cat. B is allowed where appropriate):\nUp to 5000 feet = 110 mph \n5001 to 7000 feet = 130 mph\n7001 to 8000 feet 140 mph\n8001 and up = 150 mph\n\n02/13/15: The County requires a 130 mph Ultimate wind speed (101 mph Nominal) for Special Wind Region through the County (Sierra Nevada Mountains).  Site specific BUN\'s to be added to the Tool include but are not limited to: \nBU# 827187\nBU# 827188\nBU# 827190 ');
