INSERT INTO `counties_cities` VALUES ('CA', 'Riverside', '', '', '', 'G', 'Building Design Data (Wind, Seismic, and Snow)', 'Many Jurisdictions', '110 Ultimate (3s) 130 Ultimate (3s)\nsee Notes', 'Chandra Desai', '(951) 955-5331', '', '42151', 'Special Wind Regions to use 130 mph Ultimate (101 mph Nominal): Cabazon, Desert Hot Springs, Garnet, Mira Loma, Hidden Springs, Painted Hills, Snow Creek Village, Thousand Palms, West Palm Springs, White Water, Windy Point.  All other locations require 110 mph Ultimate (85 mph Nominal) wind speed.\nLink for Special Wind Regions (wind speeds) has not been updated by the County.\nReport Format Requirement:\nIn addition to a standard report, a 24? x 36? drawing summary is required per the jurisdictional official?s requirements. The drawing should include everything that is in the report minus the tnxTower output (Appendix A) plus an elevation view (MTO) placed on a standard AutoCAD drawing template. All wind/seismic design data should be summarized in tabular form on the first sheet. Each sheet should be signed/sealed by the engineer. See BU#879015 for example.');
