INSERT INTO `counties_cities` VALUES ('FL', 'Brevard', '', '', '', 'G', 'Special Wording & Wind Speed Requirements', 'Entire County', 'Special Wording & \n\nSee Link to Wind Maps', 'Building Code Dept', '(321) 633-2072', '', '41367', '\"The tower does not supply any emergency services or have antennas currently attached or proposed for attachment which do or will broadcast on emergency channels. The tower is considered Structure Class II under ASCE7-05 and Risk Category II under ASCE7-10.\"\n\nSee Link to County Wind Maps');
