INSERT INTO `counties_cities` VALUES ('FL', 'Brevard', '', '', '', 'G', '', 'Titusville', 'ATC', 'Paul Ballington- Building Plans Manager', '(321) 567-3766', 'paul.ballington@titusville.com', '42899', 'The City does not require the use of Brevard County wind maps, please use ATC wind speeds for sites within the City of Titusville.');
INSERT INTO `counties_cities` VALUES ('FL', 'Broward', '', '', '', 'G', '', 'County - INCLUDES ALL Municipalities within the County', '170 (3s) Ultimate', '', '', '', '42530', 'Per the 2014 FBC, the analyses should reference section 1620.2, and 1601.1.  Previous wording referenced section 1609 which converts ultimate windspeed to nominal.  This section is not valid in High Velocity Hurricane Zones (HVHZ).  Going forward we need to run the Analysis using the Ultimate windspeed (no conversion to Nominal).  The County also has a minimal requirement of Exposure C (Exposure B is not allowed).\nNew Default wording: \"This analysis has been performed in accordance with the 2014 Florida Building Code, 5th Edition, based on an ultimate 3-second gust wind speed of 170 mph per Section 1620.2, as required by the Exception of Section 1601.1.  Exposure Category C and Risk Category II were used in this analysis.?\nINSTRUCTIONS: The tnxTower run must be done checking the box for ASCE 7-10 wind speeds (Do Not Use TIA load combinations).\n\nPlease submit SAs and SDDs with both normal paper copies and Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
