INSERT INTO `counties_cities` VALUES ('FL', 'Dade (Miami-Dade)', '', '', '', 'G', '', 'County - INCLUDES ALL Municipalities within the County', '175 (3s) Ultimate', 'Leon Cuervo: \nMiami-Dade County', '(786) 315-2052', 'cuervol@miamidade.gov', '42250', 'Per the 2014 FBC, the analyses should reference section 1620.2, and 1601.1.  Previous wording referenced section 1609 which converts ultimate windspeed to nominal.  This section is not valid in High Velocity Hurricane Zones (HVHZ).  Going forward we need to run the Analysis using the Ultimate windspeed (no conversion to Nominal).  The County also has a minimal requirement of Exposure C (Exposure B is not allowed).  \nNew Default wording: \"This analysis has been performed in accordance with the 2014 Florida Building Code, 5th Edition, based on an ultimate 3-second gust wind speed of 175 mph per Section 1620.2, as required by the Exception of Section 1601.1.  Exposure Category C and Risk Category II were used in this analysis.?\nINSTRUCTIONS:  The tnxTower run must be done checking the box for ASCE 7-10 wind speeds (Do Not Use TIA load combinations).');
INSERT INTO `counties_cities` VALUES ('FL', 'Dade (Miami-Dade)', '', '', '', 'G', '', 'Hialeah', '175 (3s) Ultimate\nSee Dade County', 'Code Compliance Division', '(305) 883-5832', '', '43097', 'The Building Division ensures that all construction within the City complies with the provisions of the Florida Building Code, the Miami-Dade County Code, and the City of Hialeah Ordinances.  Please comply with the current (1/6/2017) Miami-Dade County requirements.');
INSERT INTO `counties_cities` VALUES ('FL', 'Dade (Miami-Dade)', '', '', '', 'G', '', 'Key Biscayne', '175 (3s) Ultimate\nSee Dade County', 'Michael Milla', '(305) 365-8917', '', '41837', 'The Village of Key Biscayne requires Exposure D throughout the entire Island. See Dade (Miami-Dade) County for wind speed.');
INSERT INTO `counties_cities` VALUES ('FL', 'Dade (Miami-Dade)', '', '', '', 'G', '', 'North Miami Beach\nSEE DADE COUNTY FOR WIND SPEED', '136 (3s) Nominal', 'Syed Ashraf\nPhilip Azan', '(305) 948-2965', 'syed.ashraf@citynmb.com\nPhilip.Azan@citynmb.com', '3/1/2013\n7/17/2014', 'The jurisdiction requires special wording referencing Section 3108.1 of the 2010 FBC (See Default Wording doc).  Jurisdiction does not allow Section 1609.1.1 because city is within HVHZ and Section 1609 is not applicable in the HVHZ, only sections 1612, 1615-1626 and 3108 are valid');
