INSERT INTO `counties_cities` VALUES ('FL', 'Flagler', '', '', '', 'G', '', 'County', '130 (3s) Ultimate', 'Mark Boice- Interim Chief Building Official', 'O: (386) 313-4027\nCell: (386) 931-2704 ', 'mboice@flaglercounty.org', '41365', 'The county has adopted wind speed ordinance that requires 130 mph (3s) for Category II Buildings. Follow Flagler Link to right for \"Wind Speed Ordinance\" and \"Wind Speed Line Map\" documents on county website\n');
INSERT INTO `counties_cities` VALUES ('FL', 'Gulf', '', '', '', 'G', '', 'County', '130 (3s) Ultimate\n140 (3s) Ultimate\nSee Notes', 'Lee Collinsworth', '(850) 229-8944', 'lcollinsworth@gulfcounty-fl.gov', '41234', 'Gulf County has designated areas (convert to nominal wind speeds):\nSouth of the Intercoastal Waterway -140 mph (3s) Ultimate \nNorth of of the Intercoastal Waterway - 130 mph (3s) Ultimate ');
INSERT INTO `counties_cities` VALUES ('FL', 'Highlands', '', '', '', 'G', '', 'Entire County', '130 (3s) Ultimate\n140 (3s) Ultimate\nSee Notes', 'Eric Longshore- Building Official', '(863) 402-6643', 'elongsho@hcbcc.org', '42389', 'The County has a wind speed map posted on the website, see Wind Speed Line at bottom left page of link:\n\"Risk Category II Buildings: North of SR 70 and West of CR 721 is wind speed 130 (Ult.), the rest of the County is wind speed 140 130 (Ult.).\"');
INSERT INTO `counties_cities` VALUES ('FL', 'Hillsborough', '', '', '', 'G', '', 'Entire County', 'Varies', '', '', '', '41164', 'County requires the use of the ATC website for wind speed determination (See Link for directions):  Do Not round up to the next 5 mph per Crown Standards.\nhttp://www.atcouncil.org/windspeed/index.php');
