INSERT INTO `counties_cities` VALUES ('FL', 'Indian River', '', '', '', 'G', '', 'Entire County', '150 (3s) Ultimate\n160 (3s) Ultimate\nSee Notes', 'Building Dept', '(772) 226-1260', '', '41310', 'The County adopted Ordinance No. 2012-005 on 3/13/12 requiring increased wind speeds of 150 mph 3-sec gust (West of I-95) or 160 mph (East of I-95) for Risk Cat 2 buildings. See Map in Wind Maps Folder or Link p.19/33.');
INSERT INTO `counties_cities` VALUES ('FL', 'Lee', '', '', '', 'G', '', 'Entire County', 'Varies See Map', 'Sharon Reynolds- Commercial Plan Review', '239-533-8597\next. 48828', 'reynolsr@leegov.com', '42832', 'The County will accept linear interpolation between wind contours (1 mph increments), however, the interpolation must be shown on Lee County\'s map (see link) and included in the report.  Please reference the page number of the interpolation map (PDF page number) on the cover sheet of the structural report next to the interpolated wind speed.  ATC results will Not be accepted but can/should be included in the report (behind Lee County Map) for additional detail.\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
INSERT INTO `counties_cities` VALUES ('FL', 'Leon', '', '', '', 'G', 'PE Signature Issue', 'County', '', '', '', '', '42530', 'Seal and sign both cover letter and Table of Contents\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
