INSERT INTO `counties_cities` VALUES ('FL', 'Marion', '', '', '', 'G', '100', 'County', 'See Notes at right\n140 mph or \n130 mph', 'Mark\nPlan Reviewer', '(352)438-2400', '', '42530', 'Marion County has specified the following ULTIMATE Design 3-Second Gust wind speeds for Risk Category II building design (convert to Nominal wind speed for tnxTower calculations):\n130 mph, north of HWY 40\n140 mph, south of HWY 40\n\nSDD packages must include Site Maps (Google map satellite view that includes the street names with two closest cross streets and the tower?s location marked- zoomed map), Legal Descriptions, and Parcel ID?s listed on the S-1 sheet.  The EOR can obtain the required information from the Zoning and Permitting Real Estate Specialist through their TSA.\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
INSERT INTO `counties_cities` VALUES ('FL', 'Marion', '', '', '', 'G', '', 'Ocala', 'See Marion County', '', '', '', '42530', 'Please submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
INSERT INTO `counties_cities` VALUES ('FL', 'Okaloosa County', '', '', '', 'G', '', 'Fort Walton Beach', 'ATC', 'Barry Henderson- CBO', '(850) 833-9600', 'bhenderson@fwb.org', '42655', 'The City will only accept interpolation between wind contours with proper documentation.  Please remember to include the ATC wind speed results in Appendix C of the report and reference the ATC printout in default wording:\n\"...based upon an ultimate 3-second gust wind speed of xxx mph (see Appendix C for wind speed interpolation results) converted...\" ');
INSERT INTO `counties_cities` VALUES ('FL', 'Orange', '', '', '', 'G', '', 'Entire County', '142(3s) Ultimate\nor\n139(3s) Ultimate', '', '', '', '42850', 'The County requires either a 139 mph Ultimate or 142 mph Ultimate wind speed. See Orange County Wind Speed Map for wind zone locations and ultimate wind speeds (copy and paste link in browser):\nhttp://www.ocfl.net/Portals/0/Library/Permitting-Licensing/docs/WindSpeedMaps.pdf\n\nThere is also an interactive map for more precision if necessary, navigate to \"Reports\" then \"WindZone Reports\":\nhttp://ocgis3.ocfl.net/Html5Viewer/Index.html?viewer=InfoMap_Public_HTML5.InfoMap_Public\n\nSDD packages must include Site Maps (Google map satellite view that includes the street names with two closest cross streets and the tower?s location marked- zoomed map), Legal Descriptions, and Parcel ID?s listed on the S-1 sheet.  The EOR can obtain the required information from the Zoning and Permitting Real Estate Specialist through their TSA.');
INSERT INTO `counties_cities` VALUES ('FL', 'Orange', '', '', '', 'G', '', 'Orlando', '135 (3s) Ultimate', 'Don Fields- Chief Plans Examiner', '(407) 246-2654', 'don.fields@cityoforlando.net', '42530', 'The City has an amendment, Sec. 13.3. - Ultimate Design Wind Speeds, that requires a 135 mph Ultimate wind speed for Risk Category II buildings.\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
