INSERT INTO `counties_cities` VALUES ('FL', 'Orange & Osceola', '', '', '', 'G', '', 'Disney World', '139 mph Ultimate\n108 mph Nominal', 'John O\'Connor', '(407) 828-2250', '', '42314', 'The Disney World Complex (includes surrounding properties) follows the 2015 Epcot Building Code (based on ASCE 7-10) and will accept 2014 FBC compliant analyses.  The 2015 Epcot Building Code requires a 139 mph Ultimate wind speed for Risk Category II structures.  Please include the standard 2014 FBC wording and include an additional reference to the 2015 Epcot Building Code.');
INSERT INTO `counties_cities` VALUES ('FL', 'Osceola', '', '', '', 'G', '', 'County', 'Varies', 'Community Development Department', '(407) 742-0200', 'planreviewcoordinator@osceola.org', '42530', 'The County requires the Edition of the building code to be referenced on the SA cover page, ?2014 Florida Building Code, 5th Edition?.\n\nSDD packages must include Site Maps (Google map satellite view that includes the street names with two closest cross streets and the tower?s location marked- zoomed map), Legal Descriptions, and Parcel ID?s listed on the S-1 sheet.  The EOR can obtain the required information from the Zoning and Permitting Real Estate Specialist through their TSA.\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
