INSERT INTO `counties_cities` VALUES ('FL', 'Palm Beach ', '', '', '', 'G', 'Wind Map', 'County and Unincorporated Areas including:\nRoyal Palm Beach', '150(3s) Ultimate\n160(3s) Ultimate\n170(3s) Ultimate', 'Antonio Sigala, Jr.', '561-233-5057', 'asigala@co.palm-beach.fl.us', '41808', 'Please use County Wind Maps, p.3/6 of Link for Risk Category II.  Required Wind Speeds are 150 mph, 160 mph or 170 mph Ultimate; Linear Interpolation is permitted except in wind-borne debris region (see map for clarification).\n\nWhen using Exposure Category B, submit a Google Earth .pdf of the site with the 20 times height radius drawn on it.');
INSERT INTO `counties_cities` VALUES ('FL', 'Pasco', '', '', '', 'G', 'PE Signature Issue', 'County - Local Requirement', 'PE Signature Issue\n\nSee Link to Interacive Map for wind speeds', 'Jim Bowman\nGreg Cote', ' 727-847-8126\n(727) 847-8127', 'jbowman@pascocountyfl.net', '41949', 'The County requires the Table of Contents to be wet sealed along with the Cover Letter of the Report.  Previously allowed special wording on the front cover is no longer being accepted in lieu of Table of Contents seal.\n\n12/19/12 - The County Website contains an interactive map of wind speeds.  The wind speeds displayed appear to be nominal 3s wind speeds.  Keep in mind 105 mph nominal wind speed converts to both 135 mph and 136 mph Ultimate; use higher Ultimate in Report if unsure of exact wind speed or double check in ATC website.');
