INSERT INTO `counties_cities` VALUES ('FL', 'Sarasota', '', '', '', 'G', '', 'County', '150 mph Ultimate\nor\n160 mph Ultimate', 'Greg Yantorno- C.B.O.', '(941) 861-6637', 'gyantorn@scgov.net', '42530', 'Sarasota County has wind maps on website at:,\nhttp://ags.scgov.net/parcels/\nAlso, Interactive map is found within \"Wind Speed Maps (Instructions)\" on website, follow link at top of docment after readig instructions.  Parcel ID is in Regulatory if needed.\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
