INSERT INTO `counties_cities` VALUES ('FL', 'Seminole', '', '', '', 'G', '', 'County', '139 mph Ultimate\n108 mph Nominal', 'Michael Scheraldi', '(407) 327-5974', '', '42257', 'Seminole County will only accept 139 mph ultimate 3-sec gust wind speed (108 mph nominal 3-sec gust).\n\nAll applicants utilizing the Seminole County ePlan Review System must use digital signatures.  The County accepts digital signatures from the following 3rd Part Certification Authorities:\nCoSign, CoSign Cloud, EnTrust, GlobalSign, IdenTrust, VeriSign');
INSERT INTO `counties_cities` VALUES ('FL', 'Seminole', '', '', '', 'G', '', 'City of Oviedo', 'varies in accordance with risk  factor - see Notes', 'Rob Redding', '(407) 971-5767', '', '42530', 'The City of Oviedo has specified the following ULTIMATE Design 3-Second Gust wind speeds for building design (convert to Nominal wind speed for tnxTower calculations):\n\nRisk Category I: 129 mph\nRisk Category II: 139 mph\nRisk Category III and IV: 149 mph\n\nPlease submit SAs and SDDs with Digital Signatures (DocuSign or other acceptable 3rd Party certification authorities).');
