INSERT INTO `counties_cities` VALUES ('GA', 'Bryan', '', '', '', 'G', '', 'County', '120 (3s) - See Notes', 'Ron Alexander', '(912) 756-2532', 'ralexander@bryan-county.org', '41367', 'The county has a local ordinance that requires a Revision G analysis and requires a 120 mph (3s) wind speed throughout the county, however will accept lower wind speed for sites North of Fort Stewart Army Base with documentation (attach ATC pdf)');
INSERT INTO `counties_cities` VALUES ('GA', 'Chatham', '', '', '', 'G', '', 'Savannah', 'Varies, use ATC', 'Peter Ghilarducci- Plans Examiner', '(912) 651-6510', 'PGhilarducci@Savannahga.Gov', '41968', 'The City enforces the 2012 IBC and 2011 NEC; no special wind speed is required,');
INSERT INTO `counties_cities` VALUES ('GA', 'Clarke', '', '', '', 'G', '', 'Athens-Clarke County', '115 (3s) Ultimate', 'Douglas Hansford', '(706) 613-3520', 'doug.hansford@athensclarkecounty.com', '42257', 'Athens and Clarke County are a consolidated city?county (one jurisdiction).  Cover Letter must reference GA State Amendments, please check link to see if any subsequent amendments have been adopted:\n?This analysis has been performed in accordance with the 2012 International Building Code with 2014 and 2015 Georgia State Amendments, based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.?');
INSERT INTO `counties_cities` VALUES ('GA', 'Gwinnett', '', '', '', 'F', '75', 'Snellville', '75', 'Jason Thompson', '770-985-3518', '', '40913', 'The City will Not accept stress level greater than 100%');
INSERT INTO `counties_cities` VALUES ('GA', 'Gwinnett', '', '', '', 'G', '', 'County', '115 (3s) Ultimate', 'Prem Shah', '678-518-6094', '', '41374', 'The County will only accept soil interaction stress levels up to 105% (Crown Castle Engineering Standard is 110%)');
INSERT INTO `counties_cities` VALUES ('HI', 'Honolulu', '', '', '', 'F', '', 'Entire County', '90 (fm)/105(3s)', 'Jing Meng', '(808) 768-8235', 'jing.meng@honolulu.gov', '42557', 'The County currently enforces the 2006 IBC w/amendments.  Current local wind requirement is 105 mph (3s) per ASCE 7-05 and should be converted to fastest mile by the 2006 IBC calculation (90 mph fastest mile).  Show both FM and 3S gust wind speeds in the Rev F SA report.  Do NOT make any adjustment with a Directionality Factor to the wind pressure for a TIA/EIA-222-F analysis (0.85 for triangular tower).');
INSERT INTO `counties_cities` VALUES ('HI', 'Hawaii', '', '', '', 'F', '', 'Entire County', 'Varies from 90 (3s) to 180 (3s)', 'Neil C Erickson ', '(808) 961-8473', 'nerickson@co.hawaii.hi.us', '41696', 'Use wind speeds from the interactive \'Hawaii County Wind speed Maps\' (Link pgs. 58-84) and convert to Fastest Mile with the following wording, \"This analysis has been performed in accordance with 2006 IBC Section 1609.1.1, Exception #4 and the TIA/EIA-222-F Standard with a fastest mile wind speed of XXX mph (equivalent to the 3-sec wind speed of XXX mph indicated in the Hawai\'i County Wind Maps on the Hawai\'i County Website).  Do Not consider the exposure and topographic factors specified in the wind maps since this is a Rev. F analysis and Towers will typically be over 100\'.');
