INSERT INTO `counties_cities` VALUES ('NJ', '', '', '', '', 'G', '', 'NJDOT, NJTA and DCA Managed BUNs:\nThese sites will be identified on the Tower Rating Data page of each BUN.', '', '', '', '', '42850', 'Sites managed by New Jersey Turnpike Authority (NJDOT), New Jersey Turnpike Authority (NJTA) and New Jersey Department of Community Affairs (DCA).  NJ DOT will not allow a passing rating over 100% and requires the following language:\nSatisfies the guidelines as stated in the TIA-222-G standard and the State of New Jersey UCC \nSection N.J.A.C.5:23-6.6(c) as stated below:\nThe work shall not cause any diminution of existing structural strength, system capacity or mechanical\nventilation below that which exists at the time of application for a permit or that which is required by the\napplicable subcodes of the Uniform Construction Code, whichever is lower. The replacement or addition of\nfixtures, equipment or appliances shall not increase loads on these systems unless the system is upgraded in\naccordance with the applicable subcode of the UCC to accommodate the increased load.');
