INSERT INTO `counties_cities` VALUES ('NY', '', '', '', '', 'G', '', 'NYSP Managed BUNs\n', '', '', '', '', '42906', 'Sites managed by NYSP will not allow a passing rating over 100%.  Please provide a TIA-222-G compliant analysis with Structure Class III,  1\" minimun ice with 70mph wind gusts.  New York State Managed Sites can be identified internally by verifying the District on the tower site page shows \"State of NY - Managed Site\", External Vendors can identify by verifying the \"Jurisdiction Name\" within the Tower Rating Data link on the PCR page shows \"NY - STATE OF NEW YORK \". See BU# 801518 for an example.\nBU#\'s included but not limited to: 801372, 801373, 801374, 801518, 810696, 849858');
INSERT INTO `counties_cities` VALUES ('NY', 'Dutchess', '', '', '', 'G', '', 'Fishkill aka East Fishkill', '120 (3s) Ultimate', 'Joel Petrus- Building Inspector', '(845) 831-7800', 'jpetrus@fishkill-ny.gov', '42755', 'The jurisdiction will not accept stresses between 100% and 105% being shown as failing in the tnxTower output and wants either the 105% note to be added on the last page of the Output as well, or values manually changed to pass (with no red X?s next to them), or a signed and sealed letter from EOR explaining why the output shows \"Fail\" and report shows \"Pass\"\n\nThe Town is in a special wind region and requires a 120 mph Ultimate 3-sec gust wind speed. The wind speed was confirmed with the Building Inspector, the attachment is outdated.');
