INSERT INTO `counties_cities` VALUES ('NY', 'New York County', '', '', '', 'G', '', 'New York City', '98 mph (3s)', 'Buildings Department', '(212) 566-5000', 'ConstructionCodes@buildings.nyc.gov', '42117', 'The City including the 5 Counties [Boroughs]\n\n1. New York County [Manhattan], \n2. Kings County [Brooklyn], \n3. Bronx County [The Bronx], \n4. Richmond County [Staten Island], and \n5. Queens County [Queens]\n\nhave adopted the 2014 NYC Construction Codes (City amended version of the 2009 IBC).  Please perform a TIA-222-G compliant analysis for sites within NYC City Limits using a 98 mph 3-sec gust wind speed per Amendment:  \n1609.3 Basic wind speed. [The basic wind speed for New York City which is measured at 33 feet (10 058 mm) above ground as 3-second gust speed is 98 mph (43.8 m/s).] The basic wind speed for New York City is 98 mph (43.8m/s).\nExposure Category:\nThe City does require the use of Exposure Category D (normally excluded from Hurricane Prone Regions).  Maps with predetermined Exposure Categories C and D for each Borough/County are included in Chapter 16 of the Building Code p.26/60.  Exposure Category B can be used in areas where Exposure D is Not required; See Link \"5. BUILDING CODE\" then \"CHAPTER 16 STRUCTURAL DESIGN\"');
