INSERT INTO `counties_cities` VALUES ('OH', '', '', '', '', '', '', 'State of OHIO', '', '', '', '', '41775', 'Sites within the State of Ohio should have the following default wording unless a Jurisdiction specific Exception exists:\n\"The analysis has been performed in accordance with the TIA-222-G Standard based upon a wind speed of 90 mph 3-second gust, exposure category X with topographic category X and crest height of XXX feet as allowed per Section 3108 of the 2011 Ohio Building Code.\"\nNote: ?topographic category X and crest height of XXX feet? can be omitted if topographic category 1 (no topographic effects apply) is used.');
