INSERT INTO `counties_cities` VALUES ('OH', 'Hamilton', '', '', '', 'G', '', 'County', '', 'Dennis Dickard                Jack Derr', '513-946-4550\n(513) 946-4519', 'dennis.dickard@hamilton-co.org', '42356', 'Jurisdiction requires the following language at end of first paragraph of cover letter: \"Per Section 2.7.3 of ANSI/TIA-222-G, earthquake effects may be ignored in regions where the spectral response acceleration at short periods (Ss) is less than 1.00, which is the case in Hamilton County, Ohio where the maximum value of Ss is 0.19.  Therefore, earthquake effects have not been considered in this analysis.\"  The report must also reference the 2011 Ohio Building Code and the ANSI/TIA-222-G-2009 Standard.  The jurisdiction must receive six (6) wet sealed copies of the SA report.\n\n4/24/13 - The jurisdiction requires the Geotechnical Report to be included in the Structrural Analysis\n6/24/13 - New Requirements per County Official Jack Derr:\n  > The jurisdiction won\'t accept a RCT (Foundation reaction comparison).\n  > The structural analysis must include a base plate verification for the SST tower.\n  > The jurisdiction demands a bearing ratio in % (Demand / Capacity) even for monopole structure.\n2/5/14 - Added Link to webpage showing communities the County provides services to.\n7/24/15: The County will not accept a passing rating >100%.\n12/18/15: The County will accept SA?s under 105% as long as the Foundations do Not exceed 100%.  It is crucial that our SA?s match what has previously been submitted with Hamilton County or they will reject it based on that alone regardless of the percentage. It is considered as work completed (either adding or removing equipment) without a permit.');
INSERT INTO `counties_cities` VALUES ('OH', 'Portage', '', '', '', 'G', '', 'Streetsboro', '90 (3s)', 'CT Consultants, William Gallagher', '(330) 626-4942', '', '42709', 'The City has an ordinance that requires a minimum wind speed of 100 mph 3-sec gust for New telecommunications towers.  Existing Towers can be analyzed to a 90 mph 3-sec gust wind speed.  The City will be removing the 100 mph requirement for all towers in the future.');
