INSERT INTO `counties_cities` VALUES ('UT', 'Davis', '', '', '', 'G', '', 'Centerville', '150 (3s) Ultimate', 'Myron Williams - Building Official', '(801) 292-8232', 'mwilliams@sunrise-eng.com', '19/08/2014', 'The City requires a 150 mph Ultimate wind speed and states \"Exposure:  Site specific. Most of Centerville City is classified as Exposure \"B\"; please verify exposure before using B however.');
