INSERT INTO `counties_cities` VALUES ('VA', 'Entire State', '', '', '', 'G', '', 'State of VIRGINIA', '', '', '', '', '19/06/2014', 'Use standard 2012 IBC wording however, replace \"2012 IBC\" with \"2012 Virginia Construction Code\"\n\nState of Virginia did NOT adopt Section 3403 of the 2012 IBC, but did adopt the 2012 International Existing Building Code (IEBC), so if stress level is > 100% you must reference the 2012 IEBC Section 1007.1 Exception #1');
INSERT INTO `counties_cities` VALUES ('VA', 'Bland', '', '', '', 'G', '', 'County', '115 (3s) Ultimate\n or \n142 (3s) Ultimate', 'Joel Cagle, CBO', '(276) 688-4622', '', '23/07/2015', 'The County is in a special wind region and requires any structure with a height greater than or equal to 4,000 ft above sea level should receive a 110mph (3s) Nominal and any structure less than 4,000 ft above sea level should receive a 90mph (3s) Nominal.  If topo is being considered ( Kzt > 1.0), use 90 mph (3s) Nominal only with Kzt.');
INSERT INTO `counties_cities` VALUES ('VA', 'Fairfax', '', '', '', 'G', '', 'Fairfax County', 'Varies', 'Maire Bourque', '(703) 222-0114', '', '12/04/2016', 'The County will Not accept stress levels above 100% as passing.');
INSERT INTO `counties_cities` VALUES ('VA', 'Norfolk/Norfolk City', '', '', '', 'G', '', 'Norfolk', '129 Ultimate (3s)\n100 Nominal (3s)', 'Leon Yoder', '(757) 664-6565', '', '08/09/2014', 'The City requires a 129 mph Ultimate (Risk Cat. II), 100 mph Nominal, throughout the City.\n\n- FYI:  The Commonwealth of Virginia is divided into 95 counties and 39 independent cities, which are considered county-equivalents for census purposes.  All municipalities incorporated as cities are independent cities and are not part of a county.');
INSERT INTO `counties_cities` VALUES ('VA', 'Washington County', '', '', '', 'G', '', 'County', '100 (3s) Nominal', 'Brian Hilderbrand', '(276) 525-1320', 'bhilderbrand@washcova.com', '30/06/2015', 'The County requires a Nominal wind speed of 100 mph throughout the County including the \"Special Wind Region\".');
INSERT INTO `counties_cities` VALUES ('WA', 'Clallam County', '', '', '', 'G', '', 'County and Municipalities', 'Varies', 'See Link-\nPermits and Licenses Dept.', '(360) 417-2318', '', '13/03/2013', 'The county has wind speed requirements for municipalities within county, See Link.  Exposure Category B is not allowed.  Increased wind speeds do Not include topographic effects.  The Permits and Licenses Dept. will also confirm wind speed by site address');
INSERT INTO `counties_cities` VALUES ('WA', 'Chelan County', '', '', '', 'G', '', 'County', '135 Ultimate (3s)\n105 Nominal (3s)', 'Casey C. Headlee- Plans Examiner', '(509) 667-6582', 'Casey.Headlee@co.chelan.wa.us', '07/01/2015', 'Chelan County zoning requires a modified wind speed if the tower itself does not meet a specific setback from the property lines.  \nChapter 11.91 of the County Code:\n(3) Setbacks. Antenna support structures shall be located on the lot or license area so that the distance from the base of the tower or structure to any property line, license area boundary or adjacent/supporting structure is at least one hundred percent of the proposed structural height. Towers or structures that cannot satisfy this one hundred percent setback may be approved; provided, that the applicant presents a certification from a licensed structural engineer that the structure is designed for a basic wind speed of ninety miles per hour (fastest mile) in accordance with the currently adopted edition of the ANSI-EIA/TIA-222E.\nPlease use 135 mph Ultimate wind speed (105 mph Nominal).');
INSERT INTO `counties_cities` VALUES ('WA', 'Clark', '', '', '', 'G', '', 'Battle Ground', '135 Ultimate (3s)\n105 Nominal (3s)', 'Mark Miller- Building Official', '(360) 342-5046', 'mark.miller@cityofbg.org', '12/09/2016', 'The City requires the following Design Criteria (See Link):\n?12 inch frost depth minimum \n?Snow Load 25 pounds (live load)  \n?Per IBC 2015 and in accordance with ASCE 7-10 (135 mph ultimate); Exposure B \n?Seismic Zone D-1 ');
INSERT INTO `counties_cities` VALUES ('WA', 'Clark', '', '', '', 'G', '', 'County', '135 Ultimate (3s)\n105 Nominal (3s)', 'Sherry- Community Development', '(360) 397-2375 x4997', '', '03/06/2015', 'The County has a 135 mph 3-sec gust Ultimate (105 mph Nominal) wind speed for the entire County.  See Link, \"Commercial Design Criteria\" handout for seismic criteria by zip code and wind speed.');
INSERT INTO `counties_cities` VALUES ('WA', 'Clark', '', '', '', 'G', '75', 'City of Ridgefield', '135 Ultimate (3s)\n105 Nominal (3s)', 'John Fulkerson', '360-857-5017', '', 'Revised 3/17/11', 'Special wind region - Columbia River gorge');
INSERT INTO `counties_cities` VALUES ('WA', 'Clark', '', '', '', 'G', '75', 'City of Washougal', '142 Ultimate (3s)\n110 Nominal (3s)', 'Joseph Layman- Building Official', '(360) 835-8501, option 2', 'BuildingInspectionLine@cityofwashougal.us', '12/09/2016', 'Special wind region - Columbia River gorge');
INSERT INTO `counties_cities` VALUES ('WA', 'Clark', '', '', '', 'G', '', 'Vancouver', '135 Ultimate (3s)\n105 Nominal (3s)\nSEE NOTES', '', '', '', '', 'The City requires a 135 mph Ultimate/105 mph Nominal wind speed and 30 mph 3-second gust with 1.25\" radial ice thickness.  All Structures located inland and beyond 1500 feet of the Columbia, shall be designed per Exposure ?B?; for all structures within 1500 feet of the Columbia River, exposure shall be based on specific site location and conditions.  See Link for Design Loads Handout');
INSERT INTO `counties_cities` VALUES ('WA', 'Grays Harbor', '', '', '', 'G', '', 'County', '130 Ultimate (3s) or\n135 Ultimate (3s)', '', '', '', '16/11/2012', 'The County has posted wind and seismic maps with Design Criteria; follow link and click on \"#16 Wind and Seismic Zone Maps\":\nhttp://www.co.grays-harbor.wa.us/info/pub_svcs/BldgFormBulletins.html');
INSERT INTO `counties_cities` VALUES ('WA', 'King', '', '', '', 'G', '', 'BU# 824683', '110 Ultimate (3s) \n85 Nominal (3s)', 'Randy Johnson-Real Estate Services', '(360) 705-7358', 'WirelessRequests@wsdot.wa.gov', '02/07/2015', 'Washington State Department of Transportation requires all tower structural analyses comply with Structure Class III for towers: (1) WSDOT owned right of way, (2) WSDOT radio site, (3) WSDOT-owned structure');
INSERT INTO `counties_cities` VALUES ('WA', 'King', '', '', '', 'G', '', 'Enumclaw', '120 Ultimate (3s)', 'Tom Ushing- CBO', '(360) 825-3593 x5731', '', '15/09/2015', 'The City requires a 120 mph (3s) Ultimate wind speed.');
INSERT INTO `counties_cities` VALUES ('WA', 'King', '', '', '', 'G', '', 'Mercer Island', '110 Ultimate (3s) \n85 Nominal (3s)', 'Don Cole- Building Official', '(206) 275-7701', 'don.cole@mercergov.org', '21/06/2017', 'The City will accept Kzt factors and Exposure Category determination with accompanying engineering calculations in lieu of the values in the City\'s Wind speed-up (Kzt) and Exposure map.  Please use the CC Topo and Exposure calculator tool to determine Kzt and Exposure Category then reference and include in the SA report.');
INSERT INTO `counties_cities` VALUES ('WA', 'King', '', '', '', 'G', '', 'City of Seattle', '110 Ultimate (3s) \n85 Nominal (3s)', 'Planning and Development', '(206) 684-4630', '', '31/01/2014', 'City has been mapped for topography Kzt values - see link');
INSERT INTO `counties_cities` VALUES ('WA', 'Pierce', '', '', '', 'G', '', 'Tacoma', 'Varies\nUltimate Wind Speeds', 'Scott Beard, PE, SE', '253-591-5542', 'SBEARD@ci.tacoma.wa.us', '12/09/2016', 'The map provides wind zones with Kzt values and Ultimate wind speed equivalents (which already include Kzt).  Perform a typical 2015 IBC compliant analysis with the site specific provided Kzt value in conjunction with the Nominal 85 mph wind speed (converted from 110 mph Ultimate).  Or use the equivalent Ultimate wind speeds, 110 mph - 180 mph (which already include Kzt), provided on the map and convert to Nominal in conjunction with a Kzt =1.  See Link or below for map:\n\nhttp://www.govme.org/common/gmap/MGMain.aspx \n\nThis previous requirement has not been verified for the 2012 IBC edition: Full seismic calcs are required with 10 beam elements in upper MP section.  Section 2.7.3 of TIA-222-G was not adopted per WA State amendment WAC 51-50-3108 to 2009 IBC Section 3108.1.');
INSERT INTO `counties_cities` VALUES ('WA', 'Pierce', '', '', '', 'G', '80', 'Pierce County', '110 Ultimate (3s) \n85 Nominal (3s)', 'Richard Burke', '(253) 798-7256', 'Rburke1@co.pierce.wa.us', '15/09/2015', 'Jurisdiction currently accepts 110 Ultimate (3s) / 85 Nominal (3s) wind speed from Rev G.\n1.   Seismic Calculations: Earthquake effects may be ignored ONLY for structures assigned to structure Class I in accordance with Table 2-1 in TIA-222-G  Section 2.7.3, if approved by building official.  All other exceptions within the section are not recognized by the jurisdiction.  Seismic Calculatiions shall be in accordance with Section 2.7.4 in TIA-222-G. \n2.  Topographic Category 2: In section 2.6.6.2, the extent of Topographic Category 2, escarpments, shall extend 16 times the height of the escarpment.  \n3.  Nick Lewis suggests emailing him the plat# the tower is located and he will send out the correct wind speed.  There are higher wind speed requirements in certain areas within the jurisdiction that are not published and only available through the juridiction\'s GIS software.\n4. Assume all areas are exposure C and are a Risk Category III or IV structure (unless specifically stated that is does not support essential communications equipment) and will need to meet (use) the minimum ultimate wind speed as directed from table 1609B of the 2012 IBC (115 mph ultimate wind speed ? equating to the typical 3 second gusts) and if using the ANSI/TIA-222-G standard then be sure to clearly show how you reduced to the wind speeds allowed by that code (they equate to the same wind speeds as in the table noted above) your structural cover sheet must clearly indicate starting wind speed and show any reductions utilized (if any) all clearly noted on the structural cover sheet.');
INSERT INTO `counties_cities` VALUES ('WA', 'Snohomish', '', '', '', 'G', '', 'County', '110 (3s) Ultimate', 'Vic McKinney- Senior Plans Examiner', '(425) 388-3311 x2863', 'VMcKinney@co.snohomish.wa.us', '10/11/2015', 'The County will accept the CCI Seismic sheet when seismic shear does Not govern.  If seismic controls then please perform a full modal analysis per the requirements in ASCE 7-10 and Word Doc.');
