INSERT INTO `counties_cities` VALUES ('AL', '', '', '', '2009 IBC', 'G', '', '824168', '', 'Andy Bauer, AICP - Director of Planning & Zoning\nTony Stewart - CMS', '(251) 968-1149', 'telecomsite@nuvox.net', '41653', 'Although the Tower is in Baldwin County it falls within the Gulf Shores Police District, a CMS Jurisdiction requiring 100% max stress rating; SA must comply with Gulf Shores and CMS Requirements.  Previously, two 2012 IBC compliant SAs were submitted and accepted, however, going forward, CMS will Not accept a 2012 IBC compliant analysis and must comply with current Gulf Shores building code (2009 IBC).  Building Permit will be filed with Gulf Shores.');
