INSERT INTO `counties_cities` VALUES ('AZ', '', 'Chandler', '', '2012 IBC', 'G', '', '', '', 'Jim @Plan Review and Inspections', '(480) 782-3000 x3', '', '41592', 'The City currently follows the 2012 IBC with the following the amendment:\nSubsection 1604.4 of the IBC, entitled \"Analysis\" is hereby amended by adding a new sentence to the end of the last paragraph of such subsection to read as follows: \nAdditionally, all buildings, structures and parts thereof shall be designed and constructed to resist the wind load effects of a three (3) second wind gust with a wind speed of ninety (90) miles per hour, exposure B.\nPer Jurisdiction, please use 90 mph Nominal 3-sec gust wind speed with Exp. Cat. C as the default unless Exp. Cat. B is correct.');
