INSERT INTO `counties_cities` VALUES ('AZ', '', 'Phoenix', '', '2012 IBC', 'G', '', '', '', 'Mariola Sullivan -Plans Examiner', '(602) 256-4155', '', '42752', 'The City enforces the 2012 IBC and 2011 NEC, effective July 1, 2013\nThe City Plans Examiner requires a 90 mph 3-sec gust wind speed with the following wording:\n\"The analysis has been performed in accordance with the 2012 IBC and the local code wind speed requirement of a 90 mph Nominal 3-second gust wind speed (equivalent to 116 mph Ultimate) as required for use in the TIA-222-G-05 Structural Standards for Antenna Supporting Structures and Antennas (including Addendum 1, 222-G-1, Dated 2007 and Addendum 2, 222-G-2 Dated 2009) per Exception #5 of Section 1609.1.1.  Exposure Category X,  topographic category X  and Risk Category II were used in this analysis.\"\n\n***The City requires that all SDDs (Modification Design Packages/Drawings) must be submitted as 24? x 36? PDFs.');
INSERT INTO `counties_cities` VALUES ('AZ', '', 'Prescott', '', '2012 IBC', 'G', '', '', '', 'Permit Main Desk', '(928) 777-1356', '', '42382', 'The City enforces the 2012 IBC and 2011 NEC and has amended the 2012 IBC with the \"2015 Changes to the City of Prescott 2012 International Building Code Amendments\" .  Please use the following default wording: \nThis analysis has been performed in accordance with the 2012 International Building Code and \"2015 Changes to the City of Prescott 2012 International Building Code Amendments\" based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.');
