INSERT INTO `counties_cities` VALUES ('AZ', 'Mohave', '', '', '2012 IBC', 'G', '', '', '', 'Michael Rodriguez', '(928) 757-0903', 'michael.rodriguez@mohavecounty.us', '42654', 'The County adopted the 2012 IBC and 2011 NEC on June 1, 2015.  The 90 mph Nominal wind speed is Not a minimum; Section 1609.3 was amended as follows:\n21. Section 1609. 3 Basic Wind Speed: Amend to allow for the alternative compliance method of using a Design Wind Speed of 90 MPH, with 3 second gusts, which would include the use of the 2006 IBC Shear ? Wall Bracing Design methods for code compliance.\nThe conversion equation was Not amended or deleted from Section 1609.3 and Section 1609.1.1; Please use the typical conversion from Ultimate to Nominal.');
