INSERT INTO `counties_cities` VALUES ('CO', '', 'Colorado Springs', '', '2009 IBC', 'G', '', '', '', 'Jay Eenhuis- Chief Plans Examiner', '(719) 327-2910', 'jay@pprbd.org', '42655', 'The Pikes Peak Regional Building Department enforces building codes for the following Counties/Municipalities:\nEl Paso County, Manitou Springs, Colorado Springs, Monument, Fountain, Palmer Lake, Green Mountain Falls, Woodland Park (city limits only)\n\nThe 2011 Edition of the Pikes Peak Regional Building Code (2009 IBC) amended Section 1609.3 and 1609.4.3 requiring a 100 mph (3s) and Not allowing Exp. Cat. B (p.64/125), see below.  Please reference the \"Pikes Peak Regional Building Code, 2011 Edition\" in the SA Report.');
