INSERT INTO `counties_cities` VALUES ('CO', '', 'Denver', '', '2015 IBC', 'G', '', '', '', 'Building Permit Plan Reviews\nSee Link: target Denver Building Code', '(720) 865-2705', '', '42488', 'The City adopted the 2015 IBC and 2014 NEC on March 7, 2016; effective September 12, 2016 with the following amendment:\nSection 1609.3 Ultimate design wind speed is replaced with the following, subordinate section to remain:\n1609.3 Ultimate design wind speed.  The ultimate design wind speed, Vult, and the basic wind speed to be used in the provisions of ASCE 7, V shall be as follows: \nRisk Category II buildings and structures: 115 miles per hour for all areas in the City and County of Denver located east of a line defined as the centerline of Federal Boulevard.  For areas located west of the centerline of Federal Boulevard, the wind speed shall be interpolated between the contours as defined in the report titled ?Colorado Front Range Gust Map ? ASCE 7-10 Compatible dated November 18, 2013, in which the 115 mph contour is located along the centerline of Federal Boulevard, the 125 mph contour is located along the centerline of Sheridan Boulevard, and the 140 mph contour is located along the centerline of Kipling Boulevard. ');
