INSERT INTO `counties_cities` VALUES ('CO', '', 'Littelton', '', '2012 IBC', 'G', '', '', '', 'Jim Thelen-Codes and Inspections Manager', '(303) 795-3784', 'cdjt@littletongov.org', '42391', 'The City of Littleton adopted the 2012 IBC and 2014 NEC; effective 01/01/2014 and 2/19/2015, respectively.  The City requires a Nominal 105 mph 3sec gust  wind speed per Amendment to Section 1609.1.1 and the Colorado-Front-Range-Gust-Map1.  See \"2012 International Model Codes Amendments\" pdf in weblink');
INSERT INTO `counties_cities` VALUES ('CO', '', 'Longmont', '', '2015 IBC', 'G', '', '', '', 'Ed Kotlinski-Plans Examiner', '(303) 651-8324', 'ed.kotlinski@ci.longmont.co.us', '42548', 'The City enforces the 2015 IBC and 2014 NEC effective January 1, 2016 and July 4, 2014, respectively.  Section 1609.1.1 has been amended incorrectly with IRC wind speed requirements (142 Ult./110 Nom.) and will be corrected.  Please use 139 mph Ultimate with the following wording:\n\"This analysis has been performed in accordance with the 2015 International Building Code based upon an ultimate 3-second gust wind speed of 139 mph converted to a nominal 3-second gust wind speed of 108 mph per section 1609.3.1 as amended by the City of Longmont Amendment 1604.430 and required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.\"');
