INSERT INTO `counties_cities` VALUES ('CO', 'Clear Creek', '', '', '2009 IBC\nExhibit 1', 'G', '', '', '', 'Deb Kirkham- Building Official', '(303) 679-2344', 'dkirkham@co.clear-creek.co.us', '41887', 'The County currently adopted the 2009 IBC on November 26, 2012 and has amended the Section 1609.1.1 as follows:\n1609.1.1 Determination of wind loads: Figure 1609 identifies parts of Clear Creek County to be in a Special Wind Region. The basic wind speed is 100 MPH Exposure C excepting the areas identified on the Special Wind Region Map 1609.1.1.1, these areas are determined to be 11 0 MPH Exposure C. See Exhibit 1 (SEE LINK; yellow=100 mph, red=110mph) containing Special Wind Region Map 1609.1.1.1 attached hereto and incorporated herein.\nTo access wind speeds in map, enter address and go to \'Map Layers\' under \'Data Sources\'; expand \'Building design criteria\' and check \'Wind Speed\'.  Map will now be colored red or yellow depending on address or gps coordinates.');
