INSERT INTO `counties_cities` VALUES ('CO', 'Jefferson', '', '', '2015 IBC', 'G', '', '', '', 'Jeremy Cohen\n2015 Jefferson County Building Code Supplement ', '303-271-8722', 'buildingsafety@jeffco.us', '42377', 'The County enforces the 2015 IBC and 2014 NEC, effective January 1, 2016, and has the following local requirements (See p.18/38 of Supplement):\nUse Risk Category II: 129 mph Ultimate or 100 mph Nominal (3s) with Exposure Category B.  \nException: Rocky Mountain Metropolitan Airport area between Simms St. and Wadsworth Blvd. and north of 108th Ave shall be:\nBasic wind speed 120 mph Exposure C\nUltimate Wind Speed 155 Exposure C');
