INSERT INTO `counties_cities` VALUES ('IL', '', 'Chicago', '', 'Municipal Code of Chicago', 'F or G', '', '', '', '', '', '', '41894', 'The City of Chicago does not allow capacities greater than 100%.  Both Revisions, F and G, can be used however, the 4/3 increase in allowables is not allowed in Rev. F analyses.\nExposure Category B is not allowed: Section 13-52-310 of the Chicago Building Code states, \"Reductions in wind pressure due to neighboring structures and terrain shall not be considered.\"\nRequirements for the City of Chicago:\n1) EOR must check output boxes for mast pressure and appurtenance pressure\n2) EOR must PE seal MTO page\n3) Crown golden docs listed in Table 4 of the SA need not be included in the SA, but must be marked for reference only and provided to the jurisdiction and uploaded to their appropriate file folders; drawing, geotech, or reference.\n');
