INSERT INTO `counties_cities` VALUES ('IL', 'Cook', '', '', '2009 IBC', 'G', '', '', '', 'Building and Zoning', '(312) 603-0500', '', '42753', 'The County adopted the 2009 IBC and 2014 Cook County Electrical Code on November 19, 2014; effective January 5, 2015.  All reports and drawings submitted on or after January 5, 2015 will have to conform to these codes; please reference both the TIA-222-G and 2009 IBC in the Cover Page (See Handout under \'New Regulatory Codes\' within Link).\nCook County Requirements:\n   1) The SAs that we present to Cook County must have a narrative added to the title page of the following: ?I certify that I directly supervised the completion of this Structural Analysis to the best of my knowledge and ability. I also certify that this Structural Analysis conforms to the 2009 IBC with Cook County Amendments.?\n   2) We also need to include in/attach to report  as reference the documentation (Golden Docs) listed on the SA as documents provided; these can be marked as ?Reference Only? and added to the end of the report.\n   3) Three (3) wet stamp copies individually signed of the signature page\n   4) Tower owner letter signed by a Ill. Licensed SE, stating that the assumptions made in The Structural Analysis are true and correct.\n\n1/25/2017: Please limit \"Assumptions\" in Section 3.2 of the standard SA Report to the default three:\n1) Tower and structures were built in accordance with the manufacturer?s specifications.\n2) The tower and structures have been maintained in accordance with the manufacturer?s\nspecification.\n3) The configuration of antennas, transmission cables, mounts and other appurtenances are as\nspecified in Tables 1 and 2 and the referenced drawings.\nCook County will flag and request additional information for any other assumption listed.');
