INSERT INTO `counties_cities` VALUES ('NE', 'Sarpy', '', '', '2012 IBC', 'G', '', '', '', 'Permits and Inspection', '(402) 593-2155', 'building@sarpy.com', '41248', 'The County adopted the 2012 IBC and 2014 NEC, effective January 1, 2017.  The local amendments include the addition of Section 1601.2 Criteria:\nThe climate and geographical design criteria for building construction in Sarpy County Nebraska shall be:\n1-Ground/snow load 30 lbs psf. \n2-Wind speed 90 MPH for a 3 second gust with exposure ?C?, \n3-Seismic Design Category ?B?. \n4-Weathering probability for concrete ?B?. \n5-Frost line depth 42 inches. 6-Termites, Moderate to heavy. \n7-Decay, slight to moderate. \n8-Winter design temperature, minus 5 degrees.');
