INSERT INTO `counties_cities` VALUES ('TN', 'Sevier', '', '', '2012 IBC', 'G', '', '', '', 'Chris Jenkins - Building Official', '(865) 774-7120', 'cjenkins@seviercountytn.org', '20/03/2017', 'The County enforces the 2012 IBC and requires a 100 mph Nominal 3-sec gust wind speed for Special Wind Regions within the County based on Smoky Mountain National Park Service data and 90 mph Nominal 3-sec gust for all other areas.\nPlease use:\n115 mph Ultimate converted to 90 mph Nominal or\n130 mph Ultimate converted to 100 mph Nominal for Special Wind Region (do not use 101 mph because ordinance specifies 100 mph Nominal)');
