INSERT INTO `counties_cities` VALUES ('TN', 'Sullivan', '', '', '2006 IBC', 'F', '', '', '', 'Planning and Codes Dept.', '(423) 323-6440', 'permits@sullivancountytn.gov', '03/06/2014', 'The County follows the 2006 IBC for existing Towers.\nLocal Ordinance\n\nFor New Build ONLY:  Local Zoning Ordinance requires the following (see p. 101/117 of Link)\n7.  Structural Requirements - Prior to the approval of any commercial telecommunications tower, the applicant shall provide the Planning Commission with written certification from a registered structural engineer that, as per ANSI standards, the tower is able to minimally withstand winds of 70 miles per hour with ? inch radial ice, and/or winds of 100 miles per hour, and/or wind gusts of 130 miles per hour, whichever is greater. For towers placed on buildings, the applicant shall also provide the Planning Commission such written certification, plus evidence that the building itself is structurally capable of supporting the tower and its accompanying equipment. The tower must not affect the structural integrity of the building. Wireless transmission facilities shall be designed in accordance with approved design standards.');
