INSERT INTO `counties_cities` VALUES ('TX', '', 'Bay City', '', '2009 IBC', 'G', '', '', '', '', '', '', '41305', 'Amendments - Chapter 16 is amended to read as follows: \n1609.3. Basic wind speed. The basic wind speed, in mph, for the determination of wind loads in building design shall be 110 mph (3 second gust) minimum. \n1609.4.3. Exposure categories. Exposure factor C shall be used in the calculation of all wind loads.');
