INSERT INTO `counties_cities` VALUES ('TX', '', 'Houston', '', '2012 IBC (Local Ordinance)X', 'G / Code Word 2006', '', '', '', 'Ronald A. Livingston Sr. - Senior Teresa Geisheker-Plan Analyst\nLuke Fry for Code Questions', '(832) 394-9096\n(713) 837-7701', 'Ron.Livingston@houstontx.gov', '42474', 'The City has adopted the 2012 IBC; effective February 1, 2016.  The required wind speed by amendment is 139 mph Ultimate 3-sec gust for a Risk Category II structure.  This jurisdiction is classified as Seismic Design Category A.  Chapter 34 has been amended and therefore LC6-ESA analyses will no longer be accepted, however LC6-MCC analyses are still allowed.\n311 (Building Permits and Plan Review).\nDefault Wording: \n?This analysis has been performed in accordance with the 2012 IBC with City of Houston Amendments based upon an ultimate 3-second gust wind speed of 139 mph converted to a nominal 3-second gust wind speed of 108 mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X and Risk Category II were used in this analysis.\n\nThis tower was built prior to January 1, 2016. The scope of this project does not involve emergency response equipment.?\n\nThis does NOT include South Houston (see South Houston Entry)\n\nHarris County Permit Office\n(713) 316-3548 - Address verification\n(713) 316-3521 - Express Site Group\n\nCity of Houston (Addresses) \nMonasha McKinney - (832) 394-9075\nAnna Castaneda ? (832) 394-9064\nSee link: 311 (Building Permits and Plan Review).  It has been used to confirm jurisdiction information with a very quick turnaround time.  When submitting your question you must mention this is for a building permit for a telecommunications tower.  Parts of the ETJ will not require building permits but may require electrical and/or plumbing permits therefore you must be specific.');
