INSERT INTO `counties_cities` VALUES ('TX', '', 'Port Arthur', '', '2012 IBC', 'G', '', '', '', 'Ramon ?Butch? Hass', '(409) 983-8243', '', '41201', 'City of Port Arthur has adopted 2012 IBC on October 16, 2012; No Grace Period.  The city requires the more conservative wind speeds of the 2012 International Residential Code be used for all Building and Structures including Commercial:\n120 mph 3-sec for sites inward/inland from the Port Arthur Canal (NW of Sabine Lake) & \n130mph 3-sec for sites seaward of the Port Arthur Canal. \nUse this wording for Report:\n\"This analysis has been performed in accordance with the 2012 International Building Code and the local code wind speed requirement of a 120 or 130 mph nominal 3-second gust wind speed as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with topographic category X and crest height of XXX feet and Risk Category II was/were used in this analysis.\"');
