INSERT INTO `counties_cities` VALUES ('TX', 'Chambers', '', '', '2009 IBC', 'F\nSee Notes', '', '', '', 'Ryan Holzaepfel', '(409) 267-2400', 'rholzaepfel@co.chambers.tx.us', '42902', 'The County does Not require zoning or permitting for existing Telecommunications Towers, please perform a TIA-222-F compliant analysis.  ONLY New Tower designs must be permitted and comply with the current adopted building code (currently 2009 IBC). For further clarification, if the tower was permitted in the past (at time of original construction or prior to code change) the County does Not require a new permit for Antenna, Co-Lo or Modification work and analyses/designs should comply with the original code; Rev. F is the default.');
