INSERT INTO `states` VALUES ('AL', 'http://www.bc.state.al.us/buildingcode.htm', 'IBC 2009', 'G', '', '', '', '09/01/10', 'See Alabama Tab.  State Bldg Commission adopted 2009 IBC, but they only have jurisdiction over state property, schools and high occupancy hotels and theaters.); Alabama is a home rule state.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  \nIf both the city and county have not adopted building codes, then there is no controlling building code as indicated by \"n/a\" in the table below, in which case use TIA-222-F.');
INSERT INTO `states` VALUES ('AK', 'http://dps.alaska.gov/fire/regulations.aspx', 'IBC 2009', 'G', '', '', '', '05/01/14', 'The State of Alaska adopted the 2009 IBC and 2011 NEC; effective November 16, 2012 and August 5, 2010, respectively.  Codes in Alaska are adopted by administrative rule making by either the Alaska State Fire Marshal or the Department of Labor.  The adopted codes by state agencies are mandatory and fall under state inspection programs unless a local jurisdiction has been delegated the code program as a ?deferred jurisdiction.?  When this occurs,  the local jurisdiction administers and enforces their local program of the adopted state codes.  In other words Jurisdictions may have adopted/follow a different code.');
INSERT INTO `states` VALUES ('IL', 'Illinois', 'IBC 2009', 'G', '', '', '', '07/01/10', 'Home Rule State - City or County may still use Rev. F; Controllng Jurisdiction should be Verified\n*Illinois is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes,  then use TIA-222-F unless site is in state-owned property.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the state of Illinois (for state-owned properties): 2009 IBC, which references TIA-222-G');
INSERT INTO `states` VALUES ('ME', 'Maine ', 'IBC 2009', 'G', '', '', '', '07/01/10', '');
INSERT INTO `states` VALUES ('MA', 'http://bcapcodes.org/code-status/state/massachusetts/', 'IBC 2009', 'G', '', '', '', '08/06/10', 'Please See \"MA\" Tab for Wind Speeds required by the Massachusetts Building Code 8th Edition (2009 IBC).  12/10/2015- The State is in the process of adopting their 9th Edition of the MA Building Code based on the 2015 I-Codes; preliminarily scheduled \"? in the first half of 2016\".  A new wind speed table will be available upon its adoption. \nMassachusetts: Wind Speeds per City/Town\nThe current building code for the state of Massachussetts:   2009 IBC, which references TIA-222-G (See Below Table 1604.11 Basic Wind Speeds of the MA Building Code, 8th Edition with 12/16/2013 Amendent to 16.0 Structural Loads): \nTable listing values for city/town');
INSERT INTO `states` VALUES ('NH', 'New Hampshire', 'IBC 2009', 'G', '', '', '', '01/01/10', '');
INSERT INTO `states` VALUES ('NC', 'North Carolina', 'IBC 2009', 'G', '', '', '', '09/01/11', 'w/ grace period until 3/1/2012');
INSERT INTO `states` VALUES ('OH', 'http://www.com.ohio.gov/dico/bbs/NonResidentialBuildingCodes.aspx#OBC', 'IBC 2009', 'G', '', '', '', '07/01/07', 'Sites within the State of Ohio should have the following default wording unless a Jurisdiction specific Exception exists:\n\"The analysis has been performed in accordance with the TIA-222-G Standard based upon a wind speed of 90 mph 3-second gust, exposure category X with topographic category X and crest height of XXX feet as allowed per Section 3108 of the 2011 Ohio Building Code.\"\nNote: ?topographic category X and crest height of XXX feet? can be omitted if topographic category 1 (no topographic effects apply) is used.');
