INSERT INTO `states` VALUES ('WI', 'Wisconsin ', 'IBC 2009', 'G', '', '', '', '09/01/11', 'w/o any grace period');
INSERT INTO `states` VALUES ('AR', 'Arkansas', 'IBC 2012', '', '', '', '', '01/08/2013', 'The AR Legislature approved 2012 IBC on June 1, 2013, effective: January 1, 2014.  Grace period can be issued on an individual basis if additional time is required.  The new state building code will be the Arkansas Fire Prevention Code, 2012 Edition.  NOT HOMERULE, Effective Statewide.');
INSERT INTO `states` VALUES ('CT', 'http://www.ct.gov/dcs/cwp/view.asp?a=4447&q=523368', 'IBC 2012', '', '', '', '', '9/14/2016\n\n', 'Default Wording:\"This analysis has been performed in accordance with the 2016 Connecticut State Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per Section 1609.3 and Appendix N as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of X.XXX and Risk Category II was/were used in this analysis.\"\n\nState of Connecticut does NOT allow a stress level greater than 100%.\nThe State adopted the 2012 IBC and 2014 NEC, effective October 1, 2016.  The State has added \"Appendix N Municipality - Specific Structural Design Parameters\", see page 76/168 of \"Appendix N\" Link or \"CT\" tab for Design Criteria. Please begin 2012 IBC - Rev. G compliant analyses.  Please use the following default wording:\n\"This analysis has been performed in accordance with the 2016 Connecticut State Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per Section 1609.3 and Appendix N as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of X.XXX and Risk Category II was/were used in this analysis.\"\nCT is NOT a Home Rule State; Tab added only for Design Criteria\n has Appendix N - MUNICIPALITY - SPECIFIC STRUCTURAL DESIGN PARAMETERS\nAppendix N: http://www.portal.ct.gov/das');
INSERT INTO `states` VALUES ('FL', 'http://codes.iccsafe.org/app/book/content/2014_Florida/Building%20Code/Chapter%2016.html', 'IBC 2012', '', '', '', '', '03/09/2015', 'The State of Florida adopted the 2014 FBC (2012 IBC w/State Amendments) on January 6, 2015; effective June 30, 2015.  Please begin 2014 FBC (2012 IBC w/State Amendments) compliant analyses immediately. Default Wording is as follows: \nThis analysis has been performed in accordance with the 2014 Florida Building Code, 5th Edition, based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.');
INSERT INTO `states` VALUES ('GA', 'http://www.dca.state.ga.us/development/constructioncodes/programs/codeAmendments.asp', 'IBC 2012', '', '', '', '', '19/05/2013', 'State of Georgia to adopt 2012 IBC January 1, 2014');
INSERT INTO `states` VALUES ('ID', 'Idaho', 'IBC 2012', '', '', '', '', '01/01/2014', 'The State adopted the 2012 IBC effective 01/01/2014');
INSERT INTO `states` VALUES ('IN', 'http://www.in.gov/dhs/2375.htm', 'IBC 2012', '', '', '', '', '12/09/2014', 'The State adopted the Indiana Building Code (2012 IBC with Amendments), effective December 1, 2014.  The State will allow 2012 IBC compliant SA\'s prior to the effective date.  Please BEGIN performing  2012 IBC - Rev. G compliant Immediately, September 18, 2014.  Note: the Indiana Tab with Table 1608.2 (Wind Speeds, Snow Load and Foundation Depth and Seismic Parameters) has been changed, Wind Speeds are to be taken from the 2012 IBC; Seismic Parameters remain unchanged from the 2008 Indiana Building Code (2006 IBC).\n\nThe State adopted the Indiana Building Code (2012 IBC with Amendments), effective December 1, 2014.  The State will allow 2012 IBC compliant SA\'s prior to the effective date.  Please BEGIN performing  2012 IBC - Rev. G compliant Immediately, September 18, 2014.  Note: the Indiana Tab with Table 1608.2 (Wind Speeds, Snow Load and Foundation Depth and Seismic Parameters) has been changed, Wind Speeds are to be taken from the 2012 IBC; Seismic Parameters remain unchanged from the 2008 Indiana Building Code (2006 IBC).\n2014 Indiana Building Code Amendments\n675 IAC 13-2.6-17 Chapter 16; structural design\nTable 1608.2 - Scroll Down for More Info\n?> Use 2012 IBC Wind Speeds: 115 mph Ultimate l Sec. 18. Chapter 16 is amended as follows:  (k) Delete Figure 1608.2, Ground Snow Loads, pg, for the United States (psf), and insert to read as follows: Table 1608.2, Ground Snow Loads (pg) and Minimum Foundation Depth by County    1. Snow is minimum ground snow load (pg) in pounds per square foot.\n*Indicates those counties Lake, La Porte, Porter, St. Joseph with extreme variation and shall require investigation by the design professional, or owner when a design professional is not required, to determine the actual minimum ground snow load at each site; however, the determined minimum snow load (pg) shall be at least thirty (30) pounds per square foot.  Ground snow load determination for such counties shall be based on an extreme value statistical analysis of data available in the vicinity of the site using a value with a two percent annual probability of being exceeded (50-year mean recurrence interval).\n   2. Foundation is the minimum foundation depth to bottom of footing from the top of the grade above the footing in inches.  (u) Add TABLE 1613.3.4 MAXIMUM VALUES FOR SDS AND SD1 to read as follows: an image table\n\n\n\n\n\n    \n             Note 1: Site-specific geotechnical investigation and dynamic site response analyses shall be performed to determine appropriate values.\n ');
INSERT INTO `states` VALUES ('KY', 'Kentucky', 'IBC 2012', '', '', '', '', '05/09/2013', 'Kentucky adopted the 2012 IBC with an effective: January 1, 2014.  The State will allow 2012 IBC compliant SA\'s prior to the effective date  BEGIN using  2012 compliant Rev. G on October 1, 2013.');
INSERT INTO `states` VALUES ('LA', 'Louisiana', 'IBC 2012', '', '', '', '', '12/12/13', '2013 Louisiana State Uniform Construction Code (2012 IBC w/State Amendments) is mandatory statewide per the Council.   Include the revised default wording in the Report, \"This analysis has been performed in accordance with the  2013 Louisiana State Uniform Construction Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X and Risk Category II were used in this analysis.\"\nLike other 2012 IBC Jurisdictions, acquire Ultimate wind speed from the ATC website but Do Not Round the Ultimate wind speed to the next 5 mph, use 1 mph increment Ultimate wind speeds then convert to Nominal wind speed and round up or down to the nearest 1 mph for use in the analysis.');
INSERT INTO `states` VALUES ('MN', 'http://www.dli.mn.gov/CCLD/PDF/review30Summer14.pdf', 'IBC 2012', '', '', '', '', '29/08/2014', 'The State has adopted the 2012 IBC and 2014 NEC, effective January 1, 2015.  Please begin providing 2012 IBC - Rev. G compliant analyses beginning immediately.');
INSERT INTO `states` VALUES ('MS', 'Mississippi', 'IBC 2012', '', '', '', '', '01/04/2014', 'Home Rule State. The State has adopted the 2012 IBC, November 15, 2011; however, the State of Mississippi does NOT adopt or enforce a statewide building code for all structures. The State requires that only state buildings, owned or leased, comply with the 2012 IBC.\n*Mississippi is a Home Rule State and does NOT have a minimum building code requirement.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then use TIA-222-F unless site is in state-owned property.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the State of Mississippi (state-owned properties only): 2012 IBC, which references TIA-222-G using converted ultimate wind speeds');
INSERT INTO `states` VALUES ('MT', 'http://bsd.dli.mt.gov/bc/bs_index.asp', 'IBC 2012', '', '', '', '', '06/27/14', 'The State adopted the 2012 IBC, effective July 1, 2012.  Per Keith Fletcher - Plan Reviewer, the Special Wind Regions only require a 115 mph Ultimate wind speed.');
INSERT INTO `states` VALUES ('NE', 'http://nebraskalegislature.gov/laws/statutes.php?statute=71-6403', 'IBC 2012', '', '', '', '', '10/26/15', 'Home Rule State - The State adopted the 2012 IBC, effective date: August 30, 2015.  City or County may still use Rev. F; Controlling Jurisdiction should be Verified. The State of Nebraska requires a PE seal on the first and last page of the report.\n\n*Nebraska is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes,  then use TIA-222-F unless site is in state-owned property.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the state of Nebraska  (for state-owned properties): 2012 IBC, which references TIA-222-G\n*** The State of Nebraska Requires a PE Seal on the First and Last Page of the Structural Analysis Report ***\n*Nebraska: Local Jurisdiction Adopted Building Codes');
INSERT INTO `states` VALUES ('ND', 'http://www.communityservices.nd.gov/buildingcode/', 'IBC 2012', '', '', '', '', '03/04/2014', 'The State adopted the 2012 IBC, effective January 1, 2014.  If a city, county, or township elects to adopt and enforce building codes, it must adopt and enforce the State Building Code. However, a jurisdiction is permitted to further amend the State Building Code to conform to local needs. Fully chartered Home Rule Cities may adopt something other than the State Building Code, but at the present time, all that enforce a building code have elected to adopt the same individual codes that make up the State Building Code.  Local governments that have not elected to adopt and enforce the state building code are responsible for assuring that plans and specifications for alterations and new construction of their buildings comply with the state building code.');
INSERT INTO `states` VALUES ('OR', 'http://www.bcd.oregon.gov/notices/20140225_ImportantCodeChangeUpdate.pdf', 'IBC 2012', '', '', '', '', '41817', 'All Structural Analyses must reference the 2014 Oregon Structural Specialty Code (OSSC)12\nThe State has adopted the 2014 Oregon Structural Specialty Code (OSSC) based on the 2012 IBC, effective July 1, 2014 with a three month phase-in period from July 1, 2014 to September 30, 2014 to allow construction projects to be submitted to the 2014 OSSC, 2010 OSSC, or 2010 OEESC.. See p.8-10 of Wind Maps for new Risk Category II Ultimate Wind Speeds.  Please begin 2014 OSSC (2012 IBC) - Rev. G compliant analyses immediately.  All Structural Analyses must reference the 2014 Oregon Structural Specialty Code (OSSC)\nWind Maps: http://www.oregon.gov/bcd/pages/index.aspx');
INSERT INTO `states` VALUES ('RI', 'http://sos.ri.gov/documents/archives/regdocs/released/pdf/BCSC/7278.pdf', 'IBC 2012', '', '', '', '', '03/07/14', 'The State has adopted the 2013 Rhode Island State Building Code (SBC-1-2013) - 2012 IBC with State Amendments; effective July 1, 2013. See Rhode Island Tab for SBC-1 required Ultimate Wind Speeds.\nRhode Island State Building Code\nSBC-1 State Building Code 11th Edition (Amended IBC 2012)\nChapter 16; Structural - Table 1608.1\n*Line of Demarcation between 110 mph and 120 mph Zones generally is Route 1A at Watch Hill in Westerly; East to Route 1 through Westerly, Charlestown, and South Kingstown; thence Northerly along Route 1 through Narragansett, to Easterly on South Ferry Road.  See figures 1609 and 1609A. P.26/48 of PDF -See LINK');
INSERT INTO `states` VALUES ('TN', 'https://www.tn.gov/commerce/topic/fire-codes-enforcement', 'IBC 2012', '', '', '', '', '03/27/17', 'TENNESSEE: City/County - Adopted Building Codes\nThe State adopted the 2012 IBC, effective August 4, 2016 and the 2008 NEC.  Jurisdictions are allowed to enforce any edition of the IBC provided the edition is within 7 years of the State adopted code (2006 IBC or later).  Only use the State code for State owned property or if the jurisdiction does Not enforce a building code.\nTennessee is NOT Home Rule and imposes minimum building standards (currently 2012 IBC) for State owned properties, however, County and/or Municipal Jurisdictions can adopt any edition \nof the IBC provided the edition is within 7 years of the State adopted code (2006 IBC or later).  Only use the State code for State owned property or if the jurisdiction does Not enforce a building code ( indicated by \"n/a\" in the table below) and provide a 2012 IBC - TIA-222-G compliant analysis. \nThe current building code for the state of Tennessee: 2012 IBC, which references TIA-222-G.');
INSERT INTO `states` VALUES ('VT', 'http://firesafety.vermont.gov/Standards', 'IBC 2012', '', '', '', '', '05/11/2012', 'The State of Vermont has adopted the 2012 IBC on 11/5/12 with a 90 Day Grace Period');
INSERT INTO `states` VALUES ('VA', 'http://www.dhcd.virginia.gov/index.php/va-building-codes/building-and-fire-codes/regulations/uniform-statewide-building-code-usbc.html', 'IBC 2012', '', '', '', '', '06/19/14', 'The State is adopting the 2012 Virginia Uniform Statewide Building Code (2012 IBC), effective July 14, 2014.  Please submit 2012 IBC - Rev. G compliant analyses immediately.  Use standard 2012 IBC wording however, replace \"2012 IBC\" with \"2012 Virginia Construction Code\".  The Exception allowing a 105% stress has been updated in the \"Current Exceptions Tab\"');
INSERT INTO `states` VALUES ('DC', 'http://dcra.dc.gov/service/2012-code-change-cycle', 'IBC 2012', '', '', '', '', '03/12/15', 'The District of Columbia adopted the 2012 IBC and 2011 NEC, effective March 28, 2014.');
INSERT INTO `states` VALUES ('CA', 'http://www.bsc.ca.gov/Codes.aspx', 'IBC 2015', '', '', '', '', '12/09/16', 'The State adopted the 2016 California Building Code (2015 IBC with State Amendments) and 2014 NEC, effective January 1, 2017.  Include the following default wording in the Report: \"This analysis has been performed in accordance with the 2016 CBC based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X and Risk Category II were used in this analysis.\" Existing Exceptions should be researched prior to beginning a new analysis.\nThe Division of the State Architect (DSA) provides design and construction oversight for K?12 schools, community colleges, and various other state-owned and leased facilities.  The DSA requires analyses and drawings be signed by a Licensed California Structural Engineer (SE)');
INSERT INTO `states` VALUES ('CO', 'https://www.colorado.gov/pacific/osa/bldgcodes', 'IBC 2015', '', '', '', '', '42741', 'Home Rule State.  The State adopted the 2015 IBC and 2014 NEC in May of 2016 through the State Buildings Programs (SBP) as the minimum requirements for all construction by state agencies on state-owned or state lease-purchased properties or facilities.  The 2015 IBC is the minimum standard for the construction and maintenance of all Public School and Junior College Construction and Inspection.\n*Colorado is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then use TIA-222-F unless site is in state-owned property.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the state of Colorado (for state-owned properties): 2012 IBC (which references TIA-222-G-see Link \"COLORADO\"), adopted by State Buildings Programs (SBP) as the minimum requirements for all construction by state agencies on state-owned or state lease-purchased properties or facilities.  The 2015 IBC is the minimum standard for the construction and maintenance of all Public School and Junior College Construction and Inspection (see Link- top right).\nPublic School and Junior College Minimum: https://www.colorado.gov/dfpc\nCOLORADO: City/County - Adopted Building Codes\nPublic Schools: https://www.colorado.gov/dfpc');
INSERT INTO `states` VALUES ('IA', 'http://www.dps.state.ia.us/fm/building/index.shtml', 'IBC 2015', '', '', '', '', '10/03/16', 'The State adopted the 2015 IBC and 2014 NEC, effective January 1, 2017.  Grace Period: Buildings subject to the State Building or Fire Codes may be constructed to either the new 2015 edition or previous 2009 edition of the adopted codes if the project is commenced no later than January 1, 2017.\nThe Iowa State Building Code only applies to State Owned Buildings, State Financed Buildings in jurisdictions without an adopted and enforced building code, Board of Regents facilities, Modular and Manufactured homes and commercial buildings, School owned structures in jurisdictions without an adopted and enforced building code.');
INSERT INTO `states` VALUES ('MD', 'http://mdcodes2.umbc.edu/dhcd/mbps.html', 'IBC 2015', '', '', '', '', '11/02/2015', 'Language that must be included with PE wet stamp:  \"I hereby certify these documents were reviewed by me and I am a duly licensed professional engineer under the laws of the State of Maryland.\"\n\nThe State adopted the 2015 IBC effective January 1, 2015. Please begin providing 2015 IBC - Rev. G compliant analyses beginning immediately.  Default Wording shall be identical to 2012 IBC Wording replacing \"2012\" with \"2015\": \nThis analysis has been performed in accordance with the 2015 International Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.');
INSERT INTO `states` VALUES ('MI', 'http://www.michigan.gov/lara/0,4601,7-154-35299_10575---,00.html', 'IBC 2015', '', '', '', '', '09/01/2017', 'Default Wording:  \"This analysis has been performed in accordance with the 2015 Michigan Building Code and the 2015 International Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1. Exposure Category X with a maximum topographic factor, Kzt, of X.XXX and Risk Category II was/were used in this analysis.\"\n\nThe State has adopted the 2015 IBC and 2014 NEC, effective April 20, 2017.  Please begin providing 2015 IBC - Rev. G compliant analyses beginning immediately. Default Wording:  \"This analysis has been performed in accordance with the 2015 Michigan Building Code and the 2015 International Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1. Exposure Category X with a maximum topographic factor, Kzt, of X.XXX and Risk Category II was/were used in this analysis.\"');
INSERT INTO `states` VALUES ('NM', 'http://www.rld.state.nm.us/construction/rules-laws-building-codes.aspx', 'IBC 2015', '', '', '', '', '03/04/2017', 'The State adopted the 2015 New Mexico Commercial Building Code (2015 IBC), effective July 1, 2017 and the 2014 New Mexico Electrical Code (2014 NEC), effective August 1, 2014.  Both 2009 IBC and 2015 IBC compliant analyses will be accepted until July 1, 2017.  Please perform 2015 IBC compliant analyses immediately.  Jurisdictions with their own building departments may adopt the 2015 IBC on a different schedule.');
INSERT INTO `states` VALUES ('NY', 'http://www.dos.ny.gov/dcea/noticadopt.html', 'IBC 2015', '', '', '', '', '16/06/2017', 'The State has adopted the 2016 New York State Uniform Code (2015 IBC) on April 6, 2016; effective October 3, 2016.  Please perform 2015 IBC - Rev. G compliant analyses.\n\nThe State has adopted the 2016 New York State Uniform Code (2015 IBC) on April 6, 2016; effective October 3, 2016.  Please perform 2015 IBC - Rev. G compliant analyses.\n\"New York State Managed\" (NYSP) will not allow a passing rating over 100%.  Please provide a TIA-222-G compliant analysis with Structure Class III,  1\" minimum ice with 70mph wind gusts.  For Sites managed by NYSP in a Special Wind Region use the closest wind contour line to the site; NY State Managed sites do Not have a higher wind speed requirement in the special wind regions.  \nNew York State Managed Sites can be identified internally by verifying the District on the tower site page shows \"State of NY - Managed Site\", External Vendors can identify by verifying the \"Jurisdiction Name\" within the Tower Rating Data link on the PCR page shows \"NY - STATE OF NEW YORK \". \nSee BU# 801518 for an example.\nBU#\'s included but not limited to: 801372, 801373, 801347, 801518, 810696, 849858');
INSERT INTO `states` VALUES ('NJ', 'http://www.state.nj.us/dca/divisions/codes/codreg/', 'IBC 2015', '', '', '', '', '02/11/2015', 'The State adopted the 2015 IBC and 2014 NEC on September 21, 2015 and includes a 6-month grace period.  Please begin 2015 IBC-Rev. G compliant analyses immediately.  Sections 3401 - 3411 in the New Jersey Edition of the IBC 2015 have been deleted but the state has adopted the N.J.A.C. 5:23-6 Rehabilitation Subcode (reference for 105% passing rating).');
INSERT INTO `states` VALUES ('OK', 'http://www.ok.gov/oubcc/Codes_&_Rules/Adopted_Building_Codes/index.html', 'IBC 2015', '', '', '', '', '19/11/2015', 'The State adopted the 2015 IBC and 2014 NEC, effective November 1, 2015.  Jurisdictions are allowed to adopt their own amendments to the 2015 IBC.  The State does not have Enforcement Authority thus Jurisdictions may decide Not to adopt the State Building Code, acting in essence as a Home Rule State.  Controlling Jurisdiction may still use an older code and should be Verified.  Jurisdictions that have Not adopted a Building Code shall comply with the State Building Code.');
INSERT INTO `states` VALUES ('SC', 'http://www.llr.state.sc.us/pol/bcc/', 'IBC 2015', '', '', '', '', '02/08/2016', 'The State adopted the 2015 IBC, effective July 1, 2016. Per Email from Roger K. Lowe, MCP CBO, Administrator-SC Building Codes Council, \"any design work out of the IBC or ASCE 7-10 use the Applied Technology Council website for wind speeds.\"');
INSERT INTO `states` VALUES ('SD', 'http://legis.sd.gov/Statutes/Codified_Laws/DisplayStatute.aspx?Type=Statute&Statute=11-10-6', 'IBC 2015', '', '', '', '', '12/08/2015', 'The State adopted the 2015 IBC, effective July 1, 2015.  Standards for new construction where building code ordinance has not been adopted.  The design standard for any new construction commenced after July 1, 2015, within the boundaries of any local unit of government that has not adopted an ordinance prescribing standards for new construction pursuant to ? 11-10-5 shall be based on the 2015 edition of the International Building Code as published by the International Code Council, Incorporated.\nThis analysis has been performed in accordance with the 2015 International Building Code based upon an ultimate 3-second gust wind speed of xxx mph converted to a nominal 3-second gust wind speed of xxx mph per section 1609.3.1 as required for use in the TIA-222-G Standard per Exception #5 of Section 1609.1.1.  Exposure Category X with a maximum topographic factor, Kzt, of x.xxx and Risk Category II was/were used in this analysis.');
INSERT INTO `states` VALUES ('UT', 'http://www.le.utah.gov/xcode/Title15A/15A.html', 'IBC 2015', '', '', '', '', '25/08/2016', 'The State adopted the 2015 IBC and 2014 NEC on March 24, 2016; effective July 1, 2016.');
INSERT INTO `states` VALUES ('VI', 'http://building-permits.digmeonline.com/', 'IBC 2015', '', '', '', '', '30/09/2015', 'The US Virgin Islands adopted the 2015 IBC, effective October 1, 2015 and require a 165 mph Ultimate windspeed for Risk Category II structures.  Amanda Jackson-Acosta, Plan Review, (340) 773-1082, amanda.jacksona-costa@dpnr.gov.vi');
INSERT INTO `states` VALUES ('WA', 'https://fortress.wa.gov/ga/apps/sbcc/Page.aspx?nid=14', 'IBC 2015', '', '', '', '', '28/04/2016', 'For WSDOT owned towers only: Washington State Department of Transportation requires all tower structural analyses comply with Structure Class III for towers: (1) WSDOT owned right of way, (2) WSDOT radio site, (3) WSDOT-owned structure.\n\nThe State adopted the 2015 IBC, effective July 1, 2016.  For WSDOT owned towers only: Washington State Department of Transportation requires all tower structural analyses comply with Structure Class III for towers: (1) WSDOT owned right of way, (2) WSDOT radio site, (3) WSDOT-owned structure (See Link)\nWSDOT: http://www.wsdot.wa.gov/NR/rdonlyres/D585BC9F-6EE9-4512-A250-9A2BAB5D5156/0/RES447WirelessLeaseApplicationwithProcessInstructions.pdf');
INSERT INTO `states` VALUES ('WV', 'http://www.wvcoa.com/legislative-updates/', 'IBC 2015', '', '', '', '', '13/12/2016', 'The State has adopted the 2015 IBC and 2014 NEC, effective 8/1/2016.');
INSERT INTO `states` VALUES ('WY', 'http://wsfm.wyo.gov/plan-review/codes-and-standards', 'IBC 2015', '', '', '', '', '05/10/2016', 'The State adopted the 2015 IBC and 2014 NEC on November 30, 2015. Per Wyoming State Statue, municipalities and counties who have local jurisdiction must adopt these new 2015 codes by July 1, 2016.');
INSERT INTO `states` VALUES ('AZ', '', '', '', '', '', '', '', 'Arizona is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes,  then use TIA-222-F .  This is indicated by \"n/a\" in the table below.  \nThe current building code for the state of Arizona (for state-owned properties): 2003 IBC, which references TIA-222-F.');
INSERT INTO `states` VALUES ('KS', '', '', '', '', '', '', '', '*Kansas is a home rule state.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then use TIA-222-F.  This is indicated by \"n/a\" in the table below.  The State of Kansas does Not enforce a statewide building code, but authorizes local jurisdictions to adopt local building codes.  State Fire Marshal enforces building codes for state owned buildings.\nThe current building code for the state of Kansas: 2006 IBC, which references TIA-222-F');
INSERT INTO `states` VALUES ('MO', '', '', '', '', '', '', '', '*Missouri: Local Jurisdiction Adopted Building Codes\n*Missouri is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then use TIA-222-F unless site is in state-owned property.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the State of Misosuri (for state-owned properties): 2012 IBC, which references TIA-222-G using converted ultimate wind speeds');
INSERT INTO `states` VALUES ('NV', '', '', '', '', '', '', '', '*Nevada is a Home Rule State.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then use TIA-222-F.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the State of Nevada (for state-owned properties): 2006 IBC, which references TIA-222-G using converted ultimate wind speeds\nNEVADA: Local Jurisdiction Adopted Building Codes');
INSERT INTO `states` VALUES ('TX', '', '', '', '', '', '', '', 'Texas: Local Jurisdiction-Adopted Building Codes\n*Texas is a home rule state.  Begin at the city level for the applicable building code.  If the city has not adopted a building code, use the county adopted building code.  If both the city and county have not adopted building codes, then the state building code governs the jurisdiction.  This is indicated by \"n/a\" in the table below.  \nThe current building code for the state of Texas: 2006 IBC, which references TIA-222-F\nThe Texas Department of Insurance Wind Speed Maps (TDI) are only for insurance purposes, Use ONLY if the jurisdiction has an ordinance for compliance with TDI wind speed >>>\n*** Texas requires the Vendor\'s Firm Name and Number to be placed below the PE Seal.  Examples available: \nhttps://engineers.texas.gov/firmseal_faq.htm#examples\nTDI Maps: http://www.tdi.texas.gov/wind/maps/index.html');
INSERT INTO `states` VALUES ('GU', '', '', '', '', '', '', '', '');
INSERT INTO `states` VALUES ('DE', '', '', '', '', '', '', '', 'Delaware is a Home Rule State, the State only adopts and enforces the Energy, Mechanical and Plumbing Codes; the Building Codes are adopted and enforced on the County and/or Municipal levels.  ');
